package config

import (
	"fmt"
	"time"

	"github.com/tanapon395/sa-67-example/entity"
	"gorm.io/driver/sqlite"
	"gorm.io/gorm"
)

var db *gorm.DB

func DB() *gorm.DB {
	return db
}

func ConnectionDB() {
	database, err := gorm.Open(sqlite.Open("sa.db?cache=shared"), &gorm.Config{})
	if err != nil {
		panic("failed to connect database")
	}
	fmt.Println("connected database")
	db = database
}

func SetupDatabase() {

	db.AutoMigrate(
		&entity.User{},
		&entity.Gender{},
		&entity.Cart{},
		&entity.Course{},
	)

	// สร้างข้อมูล course เริ่มต้น
	course1 := entity.Course{
		Name:  "Golang Basics",
		Title: "Introduction to Go Programming",
		ProfilePicture: "data:image/png;base64,",
		Price: 29.99,
	}
	course2 := entity.Course{
		Name:  "Advanced React",
		Title: "Deep Dive into React",
		ProfilePicture: "data:image/png;base64,",
		Price: 49.99,
	}
	course3 := entity.Course{
		Name:  "Java Working",
		Title: "Learning online",
		ProfilePicture: "data:image/png;base64,",
		Price: 99.99,
	}

	// สร้างหรือค้นหา course ถ้ามีอยู่แล้ว
	db.FirstOrCreate(&course1, &entity.Course{Name: "Golang Basics"})
	db.FirstOrCreate(&course2, &entity.Course{Name: "Advanced React"})
	db.FirstOrCreate(&course3, &entity.Course{Name: "Java Working"})

	GenderMale := entity.Gender{Name: "Male"}
	GenderFemale := entity.Gender{Name: "Female"}

	db.FirstOrCreate(&GenderMale, &entity.Gender{Name: "Male"})
	db.FirstOrCreate(&GenderFemale, &entity.Gender{Name: "Female"})

	hashedPassword, _ := HashPassword("123456")
	BirthDay, _ := time.Parse("2006-01-02", "1988-11-12")
	User := &entity.User{
		FirstName: "Software",
		LastName:  "Analysis",
		Email:     "sa@gmail.com",
		Password:  hashedPassword,
		BirthDay:  BirthDay,
		Profile:   "data:image/png;base64,",
		GenderID:  3,
	}
	db.FirstOrCreate(User, &entity.User{
		Email: "sa@gmail.com",
	})


	cart := entity.Cart{
		CreateTime: time.Now(),
		Price:      course1.Price, 
		State:      "Pending",
		UserID:     &User.ID,      
		CourseID:   &course1.ID,   
	}
	
	db.FirstOrCreate(&cart)
}
